export default function cart(state = {
    cart: []
  }, action) {
    switch (action.type) {

      case 'ADD_GAME':

        return {
          ...state,
          cart: action.payload
        }

      case 'INCREASE_QUANTITY':
        debugger
        //find index
        //return state with new index
        return {
          ...state, cart: action.payload
        }

      default:
        return state;

    }
  };
